import { useState } from "react";
import "./App.css";

const App = () => {
  const [counter, setCounter] = useState(0);

  return (
    <div className="App">
      <button
        onClick={() => {
          setCounter(counter - 1);
        }}
      >
        -
      </button>
      <h1>0</h1>
      <button onClick={setCounter}>+</button>
    </div>
  );
};

export default App;
